## Implemented Trello Search Provider 
- Issue associated : #690 
- To run the trello provider add 
 `"searchproviders": {
    "trello": {
        "type": "trello.TrelloSearchProvider",
        "api_key": "YOUR_API_KEY",
        "api_token": "YOUR_API_TOKEN",
    }
}`
to your Swirl Configuration file and restart Swirl and start searching for the Trello content.
